<node TEXT="how to do Zero Delivery" ID="ID_690681839" CREATED="1383307684796" MODIFIED="1383554580201">
<icon BUILTIN="help"/>
<icon BUILTIN="help"/>
<icon BUILTIN="help"/>
<richcontent TYPE="NOTE">

<html>
  <head>
    
  </head>
  <body>
    <p>
      &#36825;&#26159;&#36319;Ulf Appelberg &lt;ulf.appelberg@ericsson.com&gt;&#20570;&#30340;&#19968;&#27425;ilib&#30340;Zero Delivery&#25152;&#20570;&#30340;&#35760;&#24405;.
    </p>
    <p>
      &#25152;&#35859;Zero delivery,&#20854;&#23454;&#26159;&#35828;,&#26412;&#36523;&#25105;&#20204;&#20570;&#36719;&#20214;&#30340;delivery&#30340;&#26102;&#20505;,&#25105;&#20204;&#33258;&#24049;&#30340;&#36719;&#20214;&#27809;&#26377;&#25913;&#21464;,&#20063;&#23601;&#26159;&#35828;&#27809;&#26377;TR,&#27809;&#26377;CR&#25913;&#21160;,&#21482;&#26159;&#22240;&#20026;&#25105;&#20204;&#20381;&#36182;&#30340;&#19968;&#20123;&#24211;&#26377;&#20102;&#25913;&#21160;,&#26377;&#20102;&#26356;&#26032;,&#25152;&#20197;&#25105;&#20204;&#20063;&#36319;&#30528;&#25226;&#33258;&#24049;&#30340;&#36719;&#20214;&#37325;&#32534;&#19968;&#19979;.
    </p>
    <p>
      
    </p>
    <p>
      &#20851;&#20110;RC SW&#30340;Zero Delivery&#30340;&#27969;&#31243;,&#23567;&#33410;&#19979;&#26469;&#30340;&#20869;&#23481;(&#21487;&#33021;&#19981;&#20934;&#30830;,&#21482;&#26159;&#26681;&#25454;&#25805;&#20316;&#35760;&#19979;&#26469;&#30340;):
    </p>
    <p>
      
    </p>
    <p>
      <font size="5">1,</font>
    </p>
    <p>
      &#22914;&#26524;&#38656;&#35201;&#36719;&#20214;&#20570;Zero Delivery&#30340;&#26102;&#20505;,&#25105;&#20204;&#20250;&#20174;CM&#25910;&#21040;&#19968;&#20010;&#20851;&#20110;delivery&#30340;request&#37038;&#20214;.
    </p>
    <p>
      &#27604;&#22914;&#36825;&#19968;&#27425;&#25105;&#20204;&#20570;&#30340;zero delivery,&#23601;&#20174;CM&#37027;&#37324;&#25910;&#21040;&#20102;request,&#24182;&#19988;&#25552;&#20379;&#20102;&#32534;&#35793;RC SW&#38656;&#35201;&#20351;&#29992;&#30340;&#26032;&#30340;ilib&#26631;&#31614;.
    </p>
    <p>
      <font color="#ff0033">[Q1]&#38500;&#20102;ilib&#30340;&#26356;&#26032;&#20250;&#35201;&#27714;&#25105;&#20204;&#20570;zero delivery,&#36824;&#26377;&#20854;&#20182;&#30340;&#24773;&#20917;&#21527;? </font>
    </p>
    <p>
      <font color="#ff0033">[Q2]&#38750;zero delivery&#30340;&#35805;,&#26159;&#24590;&#20040;&#26679;&#30340;&#19968;&#20010;&#24773;&#20917;&#21602;?</font>
    </p>
    <p>
      
    </p>
    <p>
      <font size="5">2,</font>
    </p>
    <p>
      &#36873;&#25321;&#21512;&#36866;&#30340;config spec&#25991;&#20214;,&#25991;&#20214;&#36335;&#32463;&#26159;:
    </p>
    <p>
      <b><font size="4" color="#0000ff"><i>/vobs/bts_sw/rt_sw/rc_sw/rc_sw/ConfigSpec.</i></font></b>
    </p>
    <p>
      &#28982;&#21518;,
    </p>
    <p>
      &#26356;&#26032;&quot;&#20869;&#23384;&quot;&#20013;&#30340;cs&#25991;&#20214;,&#23558;cs&#20013;&#30340;ilib&#30340;&#26631;&#31614;&#26356;&#25913;&#25104;CM&#21457;&#36807;&#26469;&#30340;&#37027;&#20010;&#26032;&#30340;&#26631;&#31614;.
    </p>
    <p>
      &#28982;&#21518;,
    </p>
    <p>
      setcs &#20004;&#27425;.&#27880;&#24847;,&#26159;&#30495;&#30340;,&#35201;set&#20004;&#27425;!(&#26356;&#25913;&#23436;cs&#25991;&#20214;&#20043;&#21518;,&#20445;&#23384;&#30340;&#26102;&#20505;,&#33258;&#21160;set&#20102;&#19968;&#27425;,&#20043;&#21518;,&#20877;&#20351;&#29992;&#21629;&#20196;ct setcs -curr&#25191;&#34892;&#19968;&#36941;.)
    </p>
    <p>
      
    </p>
    <p>
      <font size="5">3,</font>
    </p>
    <p>
      &#28982;&#21518;&#38656;&#35201;&#26356;&#26032;PCS&#25991;&#20214;,&#22312;&#19979;&#38754;&#30340;&#36335;&#32463;:
    </p>
    <p>
      <b><font size="4" color="#0000ff"><i>/vobs/bts_sw/rt_sw/rc_sw/rc_sw/rc_sw_PCS.txt</i></font></b>
    </p>
    <p>
      
    </p>
    <p>
      &#36825;&#20010;&#25991;&#20214;&#20027;&#35201;&#30340;&#20316;&#29992;&#23601;&#26159;&#35760;&#24405;delivery&#30340;&#19968;&#20123;&#20449;&#24687;,&#20027;&#35201;&#26159;&#29256;&#26412;&#20449;&#24687;&#20197;&#21450;delivery&#20102;&#21738;&#20123;&#19996;&#35199;(TR,CR&#20160;&#20040;&#30340;.)
    </p>
    <p>
      
    </p>
    <p>
      
    </p>
    <p>
      <font size="5">4,</font>
    </p>
    <p>
      &#28982;&#21518;&#38656;&#35201;&#26356;&#26032;&#20135;&#21697;&#30340;R-State.
    </p>
    <p>
      &#22312;&#32534;&#35793;&#20043;&#21069;,&#38656;&#35201;&#26356;&#26032;&#19979;&#38754;&#30340;&#25991;&#20214;&#20013;&#30340;&#20135;&#21697;&#30340;R-state:
    </p>
    <p>
      <b><font size="4" color="#0000ff"><i>/vobs/bts_sw/rt_sw/rc_sw/rc_src/rc_main/rc_prodstr.h</i></font></b>
    </p>
    <p>
      
    </p>
    <p>
      &#20351;&#29992;&#30340;R-state&#23601;&#26159;&#22312;&#19978;&#38754;&#30340;PCS&#25991;&#20214;&#20013;&#20915;&#23450;&#20351;&#29992;&#30340;&#37027;&#20010;CXC&#30340;R-state.
    </p>
    <p>
      
    </p>
    <p>
      <font size="5">5,</font>
    </p>
    <p>
      &#19978;&#38754;&#30340;&#25805;&#20316;&#37117;&#23436;&#25104;&#20043;&#21518;,&#25105;&#20204;&#21487;&#20197;&#23581;&#35797;&#24615;&#30340;&#32534;&#35793;&#20195;&#30721;,&#30475;&#33021;&#19981;&#33021;&#36890;&#36807;.
    </p>
    <p>
      <b><font size="4" color="#0000ff"><i>cd /vobs/bts_sw/rt_sw/rc_sw/rc_src_6/project/ppc_lev </i></font></b>
    </p>
    <p>
      <b><font size="4" color="#0000ff"><i>clearmake -C gnu</i></font></b>
    </p>
    <p>
      &#22914;&#26524;&#19978;&#38754;&#30340;&#21629;&#20196;&#25191;&#34892;&#20043;&#21518;,&#32534;&#35793;&#25104;&#21151;&#30340;&#35805;,&#25105;&#20204;&#23601;&#21487;&#20197;&#36827;&#34892;&#19979;&#38754;&#30340;&#25805;&#20316;&#20102;.
    </p>
    <p>
      
    </p>
    <p>
      <font size="5">6,</font>
    </p>
    <p>
      &#25509;&#19979;&#26469;&#30340;&#35805;,&#23601;&#26159;&#36827;&#34892;&#27491;&#24335;&#30340;&#32534;&#35793;.
    </p>
    <p>
      &#27491;&#24335;&#30340;&#32534;&#35793;&#20043;&#21069;,&#38656;&#35201;&#23558;VOB&#37324;&#38754;&#30340;checkout&#20986;&#26469;&#30340;&#25991;&#20214;&#37117;&#32473;&#20808;checkin(&#36825;&#20010;&#27493;&#39588;&#26159;Ulf&#35201;&#27714;&#30340;,&#19981;&#30693;&#36947;&#22914;&#26524;&#19981;checkin&#30340;&#35805;,&#20250;&#26377;&#20160;&#20040;&#38382;&#39064;)
    </p>
    <p>
      
    </p>
    <p>
      &#27491;&#24335;&#30340;&#32534;&#35793;&#20854;&#23454;&#24456;&#31616;&#21333;,&#25191;&#34892;&#19979;&#38754;&#30340;&#33050;&#26412;&#25991;&#20214;&#23601;&#34892;&#20102;.
    </p>
    <p>
      
    </p>
    <p>
      <b><font size="4" color="#0000ff"><i>/vobs/bts_sw/rt_sw/rc_sw/rc_src_6/project/Delivery_of_AMD_PPC</i></font></b>
    </p>
    <p>
      
    </p>
    <p>
      &#38656;&#35201;&#27880;&#24847;&#30340;&#26159;,&#25191;&#34892;&#30340;&#26102;&#20505;&#38656;&#35201;&#24102;&#19978;&#19968;&#20010;&#21442;&#25968;,&#23601;&#26159;delivery&#30340;&#20135;&#21697;&#30340;&#20135;&#21697;&#21495;,&#25152;&#20197;&#23454;&#38469;&#19978;&#25191;&#34892;&#30340;&#21629;&#20196;&#26159;&#20687;&#36825;&#26679;&#30340;:
    </p>
    <p>
      <b><font size="4" color="#0000ff"><i>/vobs/bts_sw/rt_sw/rc_sw/rc_src_6/project/Delivery_of_AMD_PPC </i></font><i><font size="4" color="#ff0033">CXC1234567.R12A01</font></i></b>
    </p>
    <p>
      
    </p>
    <p>
      &#25191;&#34892;&#19978;&#38754;&#30340;&#21629;&#20196;,&#36825;&#20010;&#33050;&#26412;&#20250;&#33258;&#21160;&#30340;&#32534;&#35793;&#26032;&#30340;&#36719;&#20214;,&#28982;&#21518;&#25171;&#26631;&#31614;,&#33258;&#21160;&#29983;&#25104;&#21512;&#36866;&#30340;config spec&#25991;&#20214;&#24182;&#25226;&#23427;&#33258;&#21160;&#30340;checkin&#36827;&#21435;.
    </p>
    <p>
      
    </p>
    <p>
      <font size="5">7.</font>
